    private static final Map<Material, MaterialHolder<? extends IBlockData>> MATERIALS;
    //private static final Map<String, String> JSON_LIST;

    private BD defaultState;
    private int networkId;

    public MaterialHolder(BD state, int networkId){
        this.defaultState = state;
        this.networkId = networkId;
    }

    public BD createDefaultState(){
        return (BD)this.defaultState.clone();
    }

    public BD createState(String... states) throws IllegalArgumentException {
        BD state1 = this.createDefaultState();
        for (String state : states){
            String[] property = state.split("=");
            Optional<StateValue<Object>> opState = state1.getStateValue(property[0]);
            if(!opState.isPresent()){
                throw new IllegalArgumentException("Unknown Property of " + property[0]);
            }
            opState.get().setValueFromString(property[1]);
        }
        return state1;
    }

    //TODO - SUPPORT BLOCKS THAT HAVE DIFFERENT STATE GENS
    public Optional<BD> createState(int id){
        if(id == this.networkId){
            return Optional.of(createDefaultState());
        }
        if(id > this.networkId){
            id -= this.networkId;
        }
        List<String> stateIds = new ArrayList<>(this.defaultState.getStateValues().keySet());
        stateIds.sort(Comparator.naturalOrder());
        int target = 0;
        for(String stateId : stateIds) {
            Object[] values = ((StateGenerator.EnumGenerator)this.defaultState.getStateValue(stateId).get().getGenerator()).getValues();
            for(int i = 0; i < values.length; i++){
                if((target + i) == id){
                    BD ret = createDefaultState();
                    ret.getStateValue(stateId).get().setValue(values[i]);
                    return Optional.of(ret);
                }
            }
            target =+ values.length;
        }
        return Optional.empty();
    }

    public int getNetworkId(){
        return this.networkId;
    }

